function isCollidingTopLeft(a,b){return a.x1>b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2>b.x2&&a.y1>b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2>b.y2}function isCollidingTopMiddle(a,b){return a.x1>b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2<b.x2&&a.y1>b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2>b.y2}function isCollidingTopRight(a,b){return a.x1<b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2<b.x2&&a.y1>b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2>b.y2}function isCollidingTop(a,b){return isCollidingTopLeft(a,b)||isCollidingTopMiddle(a,b)||isCollidingTopRight(a,b)}
function isCollidingBottomLeft(a,b){return a.x1>b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2>b.x2&&a.y1<b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2<b.y2}function isCollidingBottomMiddle(a,b){return a.x1>b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2<b.x2&&a.y1<b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2<b.y2}function isCollidingBottomRight(a,b){return a.x1<b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2<b.x2&&a.y1<b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2<b.y2}
function isCollidingBottom(a,b){return isCollidingBottomLeft(a,b)||isCollidingBottomMiddle(a,b)||isCollidingBottomRight(a,b)}function isCollidingMiddleRight(a,b){return a.x1<b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2<b.x2&&a.y1>b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2<b.y2}function isCollidingRight(a,b){return isCollidingMiddleRight(a,b)}function isCollidingMiddleLeft(a,b){return a.x1>b.x1&&a.x1<b.x2&&a.x2>b.x1&&a.x2>b.x2&&a.y1>b.y1&&a.y1<b.y2&&a.y2>b.y1&&a.y2<b.y2}
function isCollidingLeft(a,b){return isCollidingMiddleLeft(a,b)}function isCollidingTopBottom(a,b){return isCollidingTop(a,b)||isCollidingBottom(a,b)}function isCollidingRightLeft(a,b){return isCollidingRight(a,b)||isCollidingLeft(a,b)}function isColliding(a,b){return isCollidingTopBottom(a,b)||isCollidingRightLeft(a,b)};
